/**
 * 二分查找
 * @param n int整型 数组长度
 * @param v int整型 查找值
 * @param a int整型一维数组 有序数组
 * @return int整型
 */
func Upper_bound_(n int, v int, a []int) int {
	if n == 0 || len(a) == 0 {
		return n + 1
	}

	left, right := 0, n-1

	for left <= right {
		mid := (left + right) / 2
		if a[mid] < v {
			left = mid + 1
		} else {
			right = mid
		}
	}

	return n + 1
}
